import React from "react";
import Sidebar from "../siderbar";
import Forms from "../usuarios";
import "./styles.scss";

const Home = () => {
  return (
    <div className="home">
      <div className="home__siderbar">
        <Sidebar />
      </div>
      <div className="home_forms">
        <Forms />
      </div>
    </div>
  );
};

export default Home;
